import Snake from "./Snake";

class Point {
  private xcoord: number;
  private ycoord: number;
  constructor() {
    this.xcoord = x;
    this.ycoord = y;
  }
  public get position() {
    return this.x;
    return this.y;
  }
}

export default Point;
